  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset allows students, graduates
  of the U.S. Merchant Marine Academy and participants/graduates of the Student Incentive
  Payment (SIP) Program at the State Maritime Academies (SMA) to complete the required
  annual Compliance Report for the period of their service obligation following graduation.
  \ The related application also assists MARAD in monitoring and documenting student's
  enrollment status while attending the maritime academies, making subsidy payments
  to SMA SIP students, and maintaining a record of the maritime academy graduates
  fulfillment of their service obligations.  The MSCS also contains the graduate's
  employment determination waivers\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
